import React, { Component } from "react";

class Sizes extends Component {
  state = {};
  render() {
    return (
      <div className="sizes">
        {this.props.sizes.map(size => (
          <div className="size">{size}</div>
        ))}
      </div>
    );
  }
}

export default Sizes;
